import React, { useState, useEffect } from "react";
import "./App.css";

const FinancialData = () => {
  const [data, setData] = useState([]);
  const [sortBy, setSortBy] = useState('revenue');
  const [order, setOrder] = useState('asc');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [minRevenue, setMinRevenue] = useState('');
  const [maxRevenue, setMaxRevenue] = useState('');
  const [minNetIncome, setMinNetIncome] = useState('');
  const [maxNetIncome, setMaxNetIncome] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      let url = `http://localhost:5000/api/data?sort_by=${sortBy}&order=${order}`;

      // Add filtering criteria to the URL
      if (startDate) url += `&start_date=${startDate}`;
      if (endDate) url += `&end_date=${endDate}`;
      if (minRevenue) url += `&min_revenue=${minRevenue}`;
      if (maxRevenue) url += `&max_revenue=${maxRevenue}`;
      if (minNetIncome) url += `&min_net_income=${minNetIncome}`;
      if (maxNetIncome) url += `&max_net_income=${maxNetIncome}`;

      const response = await fetch(url);
      const data = await response.json();
      setData(data);
    };

    fetchData();
  }, [sortBy, order, startDate, endDate, minRevenue, maxRevenue, minNetIncome, maxNetIncome]);

  const handleSort = (column) => {
    const newOrder = (sortBy === column && order === 'asc') ? 'desc' : 'asc';
    setSortBy(column);
    setOrder(newOrder);
  };

  return (
    <div className="p-4">
      <div className="mb-4">
        <label>Start Year:</label>
        <input
          type="number"
          value={startDate}
          onChange={(e) => setStartDate(e.target.value)}
          className="border p-2 mx-2"
        />
        <label>End Year:</label>
        <input
          type="number"
          value={endDate}
          onChange={(e) => setEndDate(e.target.value)}
          className="border p-2 mx-2"
        />
      </div>

      <div className="mb-4">
        <label>Min Revenue:</label>
        <input
          type="number"
          value={minRevenue}
          onChange={(e) => setMinRevenue(e.target.value)}
          className="border p-2 mx-2"
        />
        <label>Max Revenue:</label>
        <input
          type="number"
          value={maxRevenue}
          onChange={(e) => setMaxRevenue(e.target.value)}
          className="border p-2 mx-2"
        />
      </div>

      <div className="mb-4">
        <label>Min Net Income:</label>
        <input
          type="number"
          value={minNetIncome}
          onChange={(e) => setMinNetIncome(e.target.value)}
          className="border p-2 mx-2"
        />
        <label>Max Net Income:</label>
        <input
          type="number"
          value={maxNetIncome}
          onChange={(e) => setMaxNetIncome(e.target.value)}
          className="border p-2 mx-2"
        />
      </div>

      <table className="min-w-full border-collapse border border-gray-200">
        <thead>
          <tr>
            <th className="border px-4 py-2 cursor-pointer" onClick={() => handleSort('year')}>Year</th>
            <th className="border px-4 py-2 cursor-pointer" onClick={() => handleSort('revenue')}>Revenue</th>
            <th className="border px-4 py-2 cursor-pointer" onClick={() => handleSort('netIncome')}>Net Income</th>
            {/* Add more columns as needed */}
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td className="border px-4 py-2">{item.year}</td>
              <td className="border px-4 py-2">{item.revenue}</td>
              <td className="border px-4 py-2">{item.netIncome}</td>
              {/* Add more columns as needed */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default FinancialData;
